let mockApiData = [
  {
    id:1,
    name: 'LOLOW'
  }
]

export const getTracks = () => dispatch => {
  return dispatch =>{
    setTimeout(()=>{
      console.log('I got tracks');
      dispatch({type: 'FETCH_TRACKS_SUCCESS', playload: [] })
    },2000)
  }
}
